contracts/Dataset.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

contract Dataset is Ownable, ReentrancyGuard, AccessControl {
    bytes32 public constant DATASET_ADMIN_ROLE = keccak256("DATASET_ADMIN_ROLE");
    bytes32 public constant VERIFIER_ROLE = keccak256("VERIFIER_ROLE");

    struct DatasetInfo {
        string name;
        string description;
        address owner;
        string dataHash; // Hash of the actual data
        string metadataHash; // IPFS hash for metadata
        uint256 createdAt;
        uint256 lastUpdated;
        uint256 version;
        bool isPublic;
        bool isVerified;
        uint256 accessPrice; // Price in wei to access dataset
        string[] tags;
        uint256 downloadCount;
        uint256 citationCount;
    }

    struct AccessRequest {
        address requester;
        uint256 datasetId;
        string purpose;
        uint256 requestedAt;
        bool isApproved;
        bool isPending;
        uint256 approvedAt;
    }

    struct DatasetVersion {
        uint256 version;
        string dataHash;
        string metadataHash;
        uint256 timestamp;
        string changeLog;
    }

    mapping(uint256 => DatasetInfo) public datasets;
    mapping(uint256 => mapping(address => bool)) public hasAccess;
    mapping(uint256 => AccessRequest[]) public accessRequests;
    mapping(uint256 => DatasetVersion[]) public datasetVersions;
    mapping(address => uint256[]) public ownerDatasets;
    mapping(string => uint256) public nameToDatasetId;

    uint256 public nextDatasetId;
    uint256[] public allDatasets;

    event DatasetRegistered(
        uint256 indexed datasetId,
        address indexed owner,
        string name,
        string dataHash
    );

    event AccessGranted(
        uint256 indexed datasetId,
        address indexed user,
        address indexed grantor
    );

    event AccessRequested(
        uint256 indexed datasetId,
        address indexed requester,
        string purpose
    );

    event DatasetUpdated(
        uint256 indexed datasetId,
        uint256 newVersion,
        string newDataHash
    );

    event DatasetVerified(uint256 indexed datasetId, bool verified);
    event DatasetDownloaded(uint256 indexed datasetId, address indexed downloader);

    modifier onlyDatasetOwner(uint256 _datasetId) {
        require(datasets[_datasetId].owner == msg.sender, "Not dataset owner");
        _;
    }

    modifier datasetExists(uint256 _datasetId) {
        require(_datasetId < nextDatasetId, "Dataset does not exist");
        _;
    }

    constructor() Ownable(msg.sender) {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _grantRole(DATASET_ADMIN_ROLE, msg.sender);
        _grantRole(VERIFIER_ROLE, msg.sender);
        nextDatasetId = 1;
    }

    /**
     * @dev Register a new dataset
     * @param _name Name of the dataset
     * @param _description Description of the dataset
     * @param _dataHash Hash of the dataset content
     * @param _metadataHash IPFS hash for metadata
     * @param _isPublic Whether the dataset is publicly accessible
     * @param _accessPrice Price to access the dataset (0 for free)
     * @param _tags Array of tags for categorization
     */
    function registerDataset(
        string memory _name,
        string memory _description,
        string memory _dataHash,
        string memory _metadataHash,
        bool _isPublic,
        uint256 _accessPrice,
        string[] memory _tags
    ) external nonReentrant returns (uint256) {
        require(bytes(_name).length > 0, "Name cannot be empty");
        require(bytes(_dataHash).length > 0, "Data hash cannot be empty");
        require(nameToDatasetId[_name] == 0, "Dataset name already exists");

        uint256 datasetId = nextDatasetId++;

        datasets[datasetId] = DatasetInfo({
            name: _name,
            description: _description,
            owner: msg.sender,
            dataHash: _dataHash,
            metadataHash: _metadataHash,
            createdAt: block.timestamp,
            lastUpdated: block.timestamp,
            version: 1,
            isPublic: _isPublic,
            isVerified: false,
            accessPrice: _accessPrice,
            tags: _tags,
            downloadCount: 0,
            citationCount: 0
        });

        // Create initial version
        datasetVersions[datasetId].push(DatasetVersion({
            version: 1,
            dataHash: _dataHash,
            metadataHash: _metadataHash,
            timestamp: block.timestamp,
            changeLog: "Initial version"
        }));

        nameToDatasetId[_name] = datasetId;
        ownerDatasets[msg.sender].push(datasetId);
        allDatasets.push(datasetId);

        // Owner always has access to their own dataset
        hasAccess[datasetId][msg.sender] = true;

        emit DatasetRegistered(datasetId, msg.sender, _name, _dataHash);

        return datasetId;
    }

    /**
     * @dev Request access to a dataset
     * @param _datasetId ID of the dataset
     * @param _purpose Purpose for accessing the dataset
     */
    function requestAccess(
        uint256 _datasetId,
        string memory _purpose
    ) external payable datasetExists(_datasetId) nonReentrant {
        DatasetInfo storage dataset = datasets[_datasetId];
        require(!hasAccess[_datasetId][msg.sender], "Already has access");
        require(msg.sender != dataset.owner, "Owner already has access");

        if (dataset.isPublic && dataset.accessPrice > 0) {
            require(msg.value >= dataset.accessPrice, "Insufficient payment");

            // Grant access immediately for public paid datasets
            hasAccess[_datasetId][msg.sender] = true;

            // Transfer payment to dataset owner
            payable(dataset.owner).transfer(msg.value);

            emit AccessGranted(_datasetId, msg.sender, dataset.owner);
        } else if (dataset.isPublic && dataset.accessPrice == 0) {
            // Grant access immediately for free public datasets
            hasAccess[_datasetId][msg.sender] = true;
            emit AccessGranted(_datasetId, msg.sender, dataset.owner);
        } else {
            // Private dataset - requires approval
            accessRequests[_datasetId].push(AccessRequest({
                requester: msg.sender,
                datasetId: _datasetId,
                purpose: _purpose,
                requestedAt: block.timestamp,
                isApproved: false,
                isPending: true,
                approvedAt: 0
            }));

            emit AccessRequested(_datasetId, msg.sender, _purpose);
        }
    }

    /**
     * @dev Grant access to a user (for private datasets)
     * @param _datasetId ID of the dataset
     * @param _user Address of the user to grant access
     * @param _requestIndex Index of the access request (if applicable)
     */
    function grantAccess(
        uint256 _datasetId,
        address _user,
        uint256 _requestIndex
    ) external datasetExists(_datasetId) onlyDatasetOwner(_datasetId) {
        require(!hasAccess[_datasetId][_user], "User already has access");

        hasAccess[_datasetId][_user] = true;

        // Update request status if applicable
        if (_requestIndex < accessRequests[_datasetId].length) {
            AccessRequest storage request = accessRequests[_datasetId][_requestIndex];
            if (request.requester == _user && request.isPending) {
                request.isApproved = true;
                request.isPending = false;
                request.approvedAt = block.timestamp;
            }
        }

        emit AccessGranted(_datasetId, _user, msg.sender);
    }

    /**
     * @dev Update dataset with new version
     * @param _datasetId ID of the dataset
     * @param _newDataHash New data hash
     * @param _newMetadataHash New metadata hash
     * @param _changeLog Description of changes
     */
    function updateDataset(
        uint256 _datasetId,
        string memory _newDataHash,
        string memory _newMetadataHash,
        string memory _changeLog
    ) external datasetExists(_datasetId) onlyDatasetOwner(_datasetId) {
        require(bytes(_newDataHash).length > 0, "Data hash cannot be empty");

        DatasetInfo storage dataset = datasets[_datasetId];
        dataset.dataHash = _newDataHash;
        dataset.metadataHash = _newMetadataHash;
        dataset.lastUpdated = block.timestamp;
        dataset.version++;

        // Add new version to history
        datasetVersions[_datasetId].push(DatasetVersion({
            version: dataset.version,
            dataHash: _newDataHash,
            metadataHash: _newMetadataHash,
            timestamp: block.timestamp,
            changeLog: _changeLog
        }));

        emit DatasetUpdated(_datasetId, dataset.version, _newDataHash);
    }

    /**
     * @dev Verify a dataset (only by verifiers)
     * @param _datasetId ID of the dataset
     * @param _verified Verification status
     */
    function verifyDataset(
        uint256 _datasetId,
        bool _verified
    ) external datasetExists(_datasetId) onlyRole(VERIFIER_ROLE) {
        datasets[_datasetId].isVerified = _verified;
        emit DatasetVerified(_datasetId, _verified);
    }

    /**
     * @dev Record dataset download (for analytics)
     * @param _datasetId ID of the dataset
     */
    function recordDownload(uint256 _datasetId) external datasetExists(_datasetId) {
        require(hasAccess[_datasetId][msg.sender], "No access to dataset");

        datasets[_datasetId].downloadCount++;
        emit DatasetDownloaded(_datasetId, msg.sender);
    }

    /**
     * @dev Update citation count
     * @param _datasetId ID of the dataset
     * @param _count New citation count
     */
    function updateCitationCount(
        uint256 _datasetId,
        uint256 _count
    ) external datasetExists(_datasetId) onlyRole(DATASET_ADMIN_ROLE) {
        datasets[_datasetId].citationCount = _count;
    }

    /**
     * @dev Get dataset information
     * @param _datasetId ID of the dataset
     * @return DatasetInfo struct
     */
    function getDataset(uint256 _datasetId) external view datasetExists(_datasetId) returns (DatasetInfo memory) {
        return datasets[_datasetId];
    }

    /**
     * @dev Get dataset versions
     * @param _datasetId ID of the dataset
     * @return Array of DatasetVersion structs
     */
    function getDatasetVersions(uint256 _datasetId) external view datasetExists(_datasetId) returns (DatasetVersion[] memory) {
        return datasetVersions[_datasetId];
    }

    /**
     * @dev Get access requests for a dataset
     * @param _datasetId ID of the dataset
     * @return Array of AccessRequest structs
     */
    function getAccessRequests(uint256 _datasetId) external view datasetExists(_datasetId) returns (AccessRequest[] memory) {
        require(
            datasets[_datasetId].owner == msg.sender || hasRole(DATASET_ADMIN_ROLE, msg.sender),
            "Not authorized to view access requests"
        );
        return accessRequests[_datasetId];
    }

    /**
     * @dev Get datasets owned by an address
     * @param _owner Address of the owner
     * @return Array of dataset IDs
     */
    function getOwnerDatasets(address _owner) external view returns (uint256[] memory) {
        return ownerDatasets[_owner];
    }

    /**
     * @dev Check if user has access to dataset
     * @param _datasetId ID of the dataset
     * @param _user Address of the user
     * @return Whether user has access
     */
    function checkAccess(uint256 _datasetId, address _user) external view returns (bool) {
        return hasAccess[_datasetId][_user];
    }

    /**
     * @dev Get all dataset IDs
     * @return Array of all dataset IDs
     */
    function getAllDatasets() external view returns (uint256[] memory) {
        return allDatasets;
    }

    /**
     * @dev Get total number of datasets
     * @return Total dataset count
     */
    function getTotalDatasets() external view returns (uint256) {
        return nextDatasetId - 1;
    }

    /**
     * @dev Add verifier role to an address
     * @param _verifier Address to add as verifier
     */
    function addVerifier(address _verifier) external onlyRole(DEFAULT_ADMIN_ROLE) {
        grantRole(VERIFIER_ROLE, _verifier);
    }

    /**
     * @dev Remove verifier role from an address
     * @param _verifier Address to remove verifier role from
     */
    function removeVerifier(address _verifier) external onlyRole(DEFAULT_ADMIN_ROLE) {
        revokeRole(VERIFIER_ROLE, _verifier);
    }
}

contracts/DeSciNFTSimple.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

contract DeSciNFTSimple is ERC721, ERC721URIStorage, Ownable, ReentrancyGuard {
    uint256 private _tokenIdCounter;

    struct ResearchNFT {
        string title;
        string description;
        address researcher;
        uint256 createdAt;
        string researchType; // "paper", "dataset", "code", "review"
        uint256 citationCount;
        uint256 impactScore;
        bool isVerified;
    }

    mapping(uint256 => ResearchNFT) public researchNFTs;
    mapping(address => uint256[]) public researcherNFTs;
    mapping(string => uint256) public titleToTokenId;

    event ResearchNFTMinted(
        uint256 indexed tokenId,
        address indexed researcher,
        string title,
        string researchType
    );

    event CitationAdded(uint256 indexed tokenId, uint256 newCount);
    event ImpactScoreUpdated(uint256 indexed tokenId, uint256 newScore);
    event NFTVerified(uint256 indexed tokenId, bool verified);

    constructor() ERC721("DeSci Research NFT", "DSCI") Ownable(msg.sender) {
        _tokenIdCounter = 1;
    }

    /**
     * @dev Mint a new research NFT
     * @param to Address to mint the NFT to
     * @param title Title of the research
     * @param description Description of the research
     * @param uri URI for the token metadata
     * @param researchType Type of research
     */
    function mintResearchNFT(
        address to,
        string memory title,
        string memory description,
        string memory uri,
        string memory researchType
    ) external nonReentrant returns (uint256) {
        require(bytes(title).length > 0, "Title cannot be empty");
        require(titleToTokenId[title] == 0, "Research with this title already exists");

        uint256 tokenId = _tokenIdCounter;
        _tokenIdCounter++;

        _safeMint(to, tokenId);
        _setTokenURI(tokenId, uri);

        researchNFTs[tokenId] = ResearchNFT({
            title: title,
            description: description,
            researcher: to,
            createdAt: block.timestamp,
            researchType: researchType,
            citationCount: 0,
            impactScore: 0,
            isVerified: false
        });

        titleToTokenId[title] = tokenId;
        researcherNFTs[to].push(tokenId);

        emit ResearchNFTMinted(tokenId, to, title, researchType);

        return tokenId;
    }

    /**
     * @dev Add a citation to increase citation count
     * @param tokenId Token ID to add citation to
     */
    function addCitation(uint256 tokenId) external {
        require(ownerOf(tokenId) != address(0), "Token does not exist");

        researchNFTs[tokenId].citationCount++;
        _updateImpactScore(tokenId);

        emit CitationAdded(tokenId, researchNFTs[tokenId].citationCount);
    }

    /**
     * @dev Update the impact score of a research NFT
     * @param tokenId Token ID to update
     */
    function _updateImpactScore(uint256 tokenId) internal {
        ResearchNFT storage research = researchNFTs[tokenId];
        research.impactScore = research.citationCount * 10;
        emit ImpactScoreUpdated(tokenId, research.impactScore);
    }

    /**
     * @dev Verify a research NFT
     * @param tokenId Token ID to verify
     * @param verified Verification status
     */
    function verifyResearch(uint256 tokenId, bool verified) external onlyOwner {
        require(ownerOf(tokenId) != address(0), "Token does not exist");

        researchNFTs[tokenId].isVerified = verified;
        emit NFTVerified(tokenId, verified);
    }

    /**
     * @dev Get research NFT details
     * @param tokenId Token ID
     * @return ResearchNFT struct
     */
    function getResearchNFT(uint256 tokenId) external view returns (ResearchNFT memory) {
        require(ownerOf(tokenId) != address(0), "Token does not exist");
        return researchNFTs[tokenId];
    }

    /**
     * @dev Get all NFTs owned by a researcher
     * @param researcher Address of the researcher
     * @return Array of token IDs
     */
    function getResearcherNFTs(address researcher) external view returns (uint256[] memory) {
        return researcherNFTs[researcher];
    }

    /**
     * @dev Get total number of minted NFTs
     * @return Total NFT count
     */
    function getTotalNFTs() external view returns (uint256) {
        return _tokenIdCounter - 1;
    }

    // Required overrides
    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721URIStorage) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}

contracts/DeSciPlatform.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "./UserProfile.sol";
import "./ZKProof.sol";
import "./DeSciNFTSimple.sol";
import "./Dataset.sol";

contract DeSciPlatform is Ownable, ReentrancyGuard {
    UserProfile public userProfileContract;
    ZKProof public zkProofContract;
    DeSciNFTSimple public nftContract;
    Dataset public datasetContract;

    struct Research {
        uint256 id;
        string title;
        string description;
        address researcher;
        uint256 datasetId;
        uint256 nftTokenId;
        uint256[] zkProofIds;
        string metadataHash;
        uint256 publishedAt;
        ResearchStatus status;
        uint256 peerReviewCount;
        uint256 averageRating;
    }

    struct PeerReview {
        uint256 researchId;
        address reviewer;
        uint256 rating; // 1-10 scale
        string comments;
        string ipfsHash;
        uint256 reviewedAt;
        bool isVerified;
    }

    enum ResearchStatus {
        Draft,
        Submitted,
        UnderReview,
        Published,
        Rejected
    }

    mapping(uint256 => Research) public researches;
    mapping(uint256 => PeerReview[]) public peerReviews;
    mapping(address => uint256[]) public researcherPublications;
    mapping(uint256 => mapping(address => bool)) public hasReviewed;

    uint256 public nextResearchId;
    uint256[] public allResearches;

    // Platform settings
    uint256 public minimumReputationToReview = 50;
    uint256 public minimumReviewsToPublish = 2;
    uint256 public reviewReward = 0.01 ether;

    event ResearchSubmitted(
        uint256 indexed researchId,
        address indexed researcher,
        string title,
        uint256 datasetId
    );

    event ResearchPublished(
        uint256 indexed researchId,
        uint256 indexed nftTokenId,
        address indexed researcher
    );

    event PeerReviewSubmitted(
        uint256 indexed researchId,
        address indexed reviewer,
        uint256 rating
    );

    event ResearchStatusChanged(
        uint256 indexed researchId,
        ResearchStatus oldStatus,
        ResearchStatus newStatus
    );

    modifier onlyRegisteredUser() {
        require(userProfileContract.hasProfile(msg.sender), "User not registered");
        _;
    }

    modifier researchExists(uint256 _researchId) {
        require(_researchId < nextResearchId, "Research does not exist");
        _;
    }

    modifier onlyResearcher(uint256 _researchId) {
        require(researches[_researchId].researcher == msg.sender, "Not the researcher");
        _;
    }

    constructor(
        address _userProfileContract,
        address _zkProofContract,
        address _nftContract,
        address _datasetContract
    ) Ownable(msg.sender) {
        userProfileContract = UserProfile(_userProfileContract);
        zkProofContract = ZKProof(_zkProofContract);
        nftContract = DeSciNFTSimple(_nftContract);
        datasetContract = Dataset(_datasetContract);
        nextResearchId = 1;
    }

    /**
     * @dev Publish research with integrated dataset and ZK proofs
     * @param _title Title of the research
     * @param _description Description of the research
     * @param _datasetName Name of the dataset
     * @param _datasetDescription Description of the dataset
     * @param _datasetHash Hash of the dataset
     * @param _metadataHash IPFS hash for research metadata
     * @param _zkProofIds Array of ZK proof IDs that validate this research
     * @param _isDatasetPublic Whether the dataset should be public
     * @param _datasetAccessPrice Price to access the dataset
     */
    function publishResearch(
        string memory _title,
        string memory _description,
        string memory _datasetName,
        string memory _datasetDescription,
        string memory _datasetHash,
        string memory _metadataHash,
        uint256[] memory _zkProofIds,
        bool _isDatasetPublic,
        uint256 _datasetAccessPrice
    ) external onlyRegisteredUser nonReentrant returns (uint256) {
        require(bytes(_title).length > 0, "Title cannot be empty");
        require(userProfileContract.isUserVerified(msg.sender), "User must be verified");

        // Verify all ZK proofs are valid and belong to the user
        for (uint256 i = 0; i < _zkProofIds.length; i++) {
            require(zkProofContract.isProofVerified(_zkProofIds[i]), "Invalid ZK proof");
            ZKProof.Proof memory proof = zkProofContract.getProof(_zkProofIds[i]);
            require(proof.submitter == msg.sender, "ZK proof not owned by researcher");
        }

        // Register dataset
        string[] memory tags = new string[](1);
        tags[0] = "research";

        uint256 datasetId = datasetContract.registerDataset(
            _datasetName,
            _datasetDescription,
            _datasetHash,
            _metadataHash,
            _isDatasetPublic,
            _datasetAccessPrice,
            tags
        );

        // Create research entry
        uint256 researchId = nextResearchId++;

        researches[researchId] = Research({
            id: researchId,
            title: _title,
            description: _description,
            researcher: msg.sender,
            datasetId: datasetId,
            nftTokenId: 0, // Will be set when published
            zkProofIds: _zkProofIds,
            metadataHash: _metadataHash,
            publishedAt: 0, // Will be set when published
            status: ResearchStatus.Submitted,
            peerReviewCount: 0,
            averageRating: 0
        });

        researcherPublications[msg.sender].push(researchId);
        allResearches.push(researchId);

        emit ResearchSubmitted(researchId, msg.sender, _title, datasetId);

        return researchId;
    }

    /**
     * @dev Submit a peer review for research
     * @param _researchId ID of the research to review
     * @param _rating Rating from 1-10
     * @param _comments Review comments
     * @param _ipfsHash IPFS hash for detailed review
     */
    function submitPeerReview(
        uint256 _researchId,
        uint256 _rating,
        string memory _comments,
        string memory _ipfsHash
    ) external onlyRegisteredUser researchExists(_researchId) nonReentrant {
        Research storage research = researches[_researchId];
        require(research.status == ResearchStatus.Submitted || research.status == ResearchStatus.UnderReview, "Research not available for review");
        require(research.researcher != msg.sender, "Cannot review own research");
        require(!hasReviewed[_researchId][msg.sender], "Already reviewed this research");
        require(_rating >= 1 && _rating <= 10, "Rating must be between 1-10");

        // Check reviewer reputation
        uint256 reviewerReputation = userProfileContract.getUserReputation(msg.sender);
        require(reviewerReputation >= minimumReputationToReview, "Insufficient reputation to review");

        // Add peer review
        peerReviews[_researchId].push(PeerReview({
            researchId: _researchId,
            reviewer: msg.sender,
            rating: _rating,
            comments: _comments,
            ipfsHash: _ipfsHash,
            reviewedAt: block.timestamp,
            isVerified: userProfileContract.isUserVerified(msg.sender)
        }));

        hasReviewed[_researchId][msg.sender] = true;
        research.peerReviewCount++;

        // Update research status
        if (research.status == ResearchStatus.Submitted) {
            research.status = ResearchStatus.UnderReview;
            emit ResearchStatusChanged(_researchId, ResearchStatus.Submitted, ResearchStatus.UnderReview);
        }

        // Calculate new average rating
        _updateAverageRating(_researchId);

        // Reward reviewer (if contract has funds)
        if (address(this).balance >= reviewReward) {
            payable(msg.sender).transfer(reviewReward);
        }

        emit PeerReviewSubmitted(_researchId, msg.sender, _rating);

        // Auto-publish if minimum reviews reached and average rating is good
        if (research.peerReviewCount >= minimumReviewsToPublish && research.averageRating >= 7) {
            _publishResearch(_researchId);
        }
    }

    /**
     * @dev Internal function to publish research as NFT
     * @param _researchId ID of the research to publish
     */
    function _publishResearch(uint256 _researchId) internal {
        Research storage research = researches[_researchId];
        require(research.status == ResearchStatus.UnderReview, "Research not ready for publishing");

        // Mint NFT for the research
        uint256 nftTokenId = nftContract.mintResearchNFT(
            research.researcher,
            research.title,
            research.description,
            research.metadataHash,
            "paper"
        );

        // Update research status
        research.nftTokenId = nftTokenId;
        research.publishedAt = block.timestamp;
        research.status = ResearchStatus.Published;

        // Update researcher reputation
        uint256 currentReputation = userProfileContract.getUserReputation(research.researcher);
        uint256 bonusReputation = research.averageRating * 10; // Bonus based on review quality
        userProfileContract.updateReputation(research.researcher, currentReputation + bonusReputation);

        emit ResearchPublished(_researchId, nftTokenId, research.researcher);
        emit ResearchStatusChanged(_researchId, ResearchStatus.UnderReview, ResearchStatus.Published);
    }

    /**
     * @dev Manually publish research (owner only)
     * @param _researchId ID of the research to publish
     */
    function manuallyPublishResearch(uint256 _researchId) external onlyOwner researchExists(_researchId) {
        _publishResearch(_researchId);
    }

    /**
     * @dev Update average rating for research
     * @param _researchId ID of the research
     */
    function _updateAverageRating(uint256 _researchId) internal {
        PeerReview[] storage reviews = peerReviews[_researchId];
        if (reviews.length == 0) return;

        uint256 totalRating = 0;
        uint256 verifiedReviews = 0;

        for (uint256 i = 0; i < reviews.length; i++) {
            totalRating += reviews[i].rating;
            if (reviews[i].isVerified) {
                verifiedReviews++;
                totalRating += reviews[i].rating; // Double weight for verified reviewers
            }
        }

        researches[_researchId].averageRating = totalRating / (reviews.length + verifiedReviews);
    }

    /**
     * @dev Get research details
     * @param _researchId ID of the research
     * @return Research struct
     */
    function getResearch(uint256 _researchId) external view researchExists(_researchId) returns (Research memory) {
        return researches[_researchId];
    }

    /**
     * @dev Get peer reviews for research
     * @param _researchId ID of the research
     * @return Array of PeerReview structs
     */
    function getPeerReviews(uint256 _researchId) external view researchExists(_researchId) returns (PeerReview[] memory) {
        return peerReviews[_researchId];
    }

    /**
     * @dev Get all research IDs by a researcher
     * @param _researcher Address of the researcher
     * @return Array of research IDs
     */
    function getResearcherPublications(address _researcher) external view returns (uint256[] memory) {
        return researcherPublications[_researcher];
    }

    /**
     * @dev Get all research IDs
     * @return Array of all research IDs
     */
    function getAllResearches() external view returns (uint256[] memory) {
        return allResearches;
    }

    /**
     * @dev Update platform settings (owner only)
     */
    function updatePlatformSettings(
        uint256 _minimumReputationToReview,
        uint256 _minimumReviewsToPublish,
        uint256 _reviewReward
    ) external onlyOwner {
        minimumReputationToReview = _minimumReputationToReview;
        minimumReviewsToPublish = _minimumReviewsToPublish;
        reviewReward = _reviewReward;
    }

    /**
     * @dev Fund the contract for review rewards
     */
    function fundReviewRewards() external payable onlyOwner {}

    /**
     * @dev Withdraw funds (owner only)
     */
    function withdraw() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    /**
     * @dev Get total number of researches
     * @return Total research count
     */
    function getTotalResearches() external view returns (uint256) {
        return nextResearchId - 1;
    }

    /**
     * @dev Update contract addresses (owner only)
     */
    function updateContractAddresses(
        address _userProfileContract,
        address _zkProofContract,
        address _nftContract,
        address _datasetContract
    ) external onlyOwner {
        userProfileContract = UserProfile(_userProfileContract);
        zkProofContract = ZKProof(_zkProofContract);
        nftContract = DeSciNFTSimple(_nftContract);
        datasetContract = Dataset(_datasetContract);
    }
}

